"use strict";(globalThis.webpackChunkdckirrberg=globalThis.webpackChunkdckirrberg||[]).push([[5894],{6042(e){e.exports=JSON.parse('{"blogPosts":[{"id":"fashion","metadata":{"permalink":"/blog/fashion","editUrl":"https://github.com/dckirrberg/webiste/edit/main/website/blog/blog/2023-06-24-fashion/index.md","source":"@site/blog/2023-06-24-fashion/index.md","title":"Vereinskollektion","description":"Hallo zusammen! Wir freuen uns, euch mitteilen zu k\xf6nnen, dass unsere Vereinskollektion nun endlich zur Verf\xfcgung steht.","date":"2023-06-24T00:00:00.000Z","formattedDate":"June 24, 2023","tags":[{"label":"Merch","permalink":"/blog/tags/merch"},{"label":"Vereinskollektion","permalink":"/blog/tags/vereinskollektion"}],"readingTime":0.63,"truncated":false,"authors":[{"name":"DC Kirrberg e.V.","title":"Die Sterne vom Tussberch","imageURL":"/img/logo.svg","key":"dckirrberg"}],"nextItem":{"title":"Neuer Sponsor","permalink":"/blog/leger"}},"content":"Hallo zusammen! Wir freuen uns, euch mitteilen zu k\xf6nnen, dass unsere Vereinskollektion nun endlich zur Verf\xfcgung steht.\\n\\n<a href=\\"http://artikel.dckirrberg.de\\">Zum Webshop</a>\\n\\nIhr k\xf6nnt ab sofort im Online-Shop vorbeischauen und euch mit unseren Artikeln eindecken.\\n\\nDas Beste daran: Ihr k\xf6nnt bereits ab einer Bestellmenge von nur einem St\xfcck zuschlagen!\\n\\nDer Shop bietet euch zudem eine einfache und unkomplizierte Bestellabwicklung. Ihr k\xf6nnt aus verschiedenen g\xe4ngigen Zahlungsmethoden w\xe4hlen, um eure Lieblingsartikel zu bezahlen.\\n\\nWICHTIG: Falls ihr euch f\xfcr ein personalisiertes Shirt oder Handtuch interessiert, m\xfcsstet ihr eure Bestellung per E-Mail aufgeben.\\n\\nSchickt einfach eine Mail an:\\n\\nlarissa.rittenauer@11teamsports.com\\n\\nund gebt alle relevanten Informationen (Artikelname, Gr\xf6\xdfe, Initialen, R\xfcckendruck - DC KIRRBERG E.V.) an.\\n\\nWir hoffen, dass euch unsere moderne Vereinskollektion gef\xe4llt und w\xfcnschen euch viel Spa\xdf beim St\xf6bern und Shoppen!\\n\\n\\n![GameOn](./fashion.jpg)\\n >"},{"id":"leger","metadata":{"permalink":"/blog/leger","editUrl":"https://github.com/dckirrberg/webiste/edit/main/website/blog/blog/2023-06-23-leger/index.md","source":"@site/blog/2023-06-23-leger/index.md","title":"Neuer Sponsor","description":"Wir freuen uns sehr, euch unseren neuen Sponsor vorzustellen: \\"Underwood Tattoos\\" @underwoodtattoos_ug - der angesagte Tattoo-Laden von Andreas Leger!","date":"2023-06-23T00:00:00.000Z","formattedDate":"June 23, 2023","tags":[{"label":"Sponsor","permalink":"/blog/tags/sponsor"},{"label":"UnderWood Tattoos","permalink":"/blog/tags/under-wood-tattoos"}],"readingTime":0.615,"truncated":false,"authors":[{"name":"DC Kirrberg e.V.","title":"Die Sterne vom Tussberch","imageURL":"/img/logo.svg","key":"dckirrberg"}],"prevItem":{"title":"Vereinskollektion","permalink":"/blog/fashion"},"nextItem":{"title":"Aufsteiger 22/23","permalink":"/blog/climb"}},"content":"Wir freuen uns sehr, euch unseren neuen Sponsor vorzustellen: \\"Underwood Tattoos\\" @underwoodtattoos_ug - der angesagte Tattoo-Laden von Andreas Leger!\\n\\nGemeinsam schreiten wir mit gro\xdfer Vorfreude in eine erfolgreiche Zukunft.\\n\\nEin herzliches Dankesch\xf6n geht an Andreas Leger und sein Team f\xfcr das Vertrauen in unseren Verein. Gemeinsam werden wir unsere sportlichen Ziele erreichen und die Erfolgsgeschichte des DC Kirrberg e.V. weiterschreiben.\\n\\nSeid au\xdferdem gespannt auf unsere nagelneuen Trikots, die wir schon bald mit Stolz pr\xe4sentieren werden.\\n\\nFolgt \\"Underwood Tattoos\\" auf den Social-Media-Kan\xe4len, um die Arbeit von Andreas und seinem Team zu entdecken.\\n\\nWir m\xf6chten uns abschlie\xdfend auch bei unseren gro\xdfartigen Fans und Sponsoren bedanken, die uns stets unterst\xfctzen. Gemeinsam sind wir stark und bereit f\xfcr eine erfolgsversprechende Zukunft!\\n\\nGood Darts euch allen\\n\\n\\n![GameOn](./leger.jpg)\\n >"},{"id":"climb","metadata":{"permalink":"/blog/climb","editUrl":"https://github.com/dckirrberg/webiste/edit/main/website/blog/blog/2023-06-11-climb/index.md","source":"@site/blog/2023-06-11-climb/index.md","title":"Aufsteiger 22/23","description":"Mit Stolz und gro\xdfer Freude verk\xfcnden wir, dass unsere 1. Mannschaft heute das entscheidende Spiel um den Aufstieg gewonnen hat!","date":"2023-06-11T00:00:00.000Z","formattedDate":"June 11, 2023","tags":[{"label":"Aufsteiger","permalink":"/blog/tags/aufsteiger"},{"label":"Aktive","permalink":"/blog/tags/aktive"},{"label":"Saison 22/23","permalink":"/blog/tags/saison-22-23"}],"readingTime":0.895,"truncated":false,"authors":[{"name":"DC Kirrberg e.V.","title":"Die Sterne vom Tussberch","imageURL":"/img/logo.svg","key":"dckirrberg"}],"prevItem":{"title":"Neuer Sponsor","permalink":"/blog/leger"},"nextItem":{"title":"Unsere aktiven Spieler","permalink":"/blog/Unsere aktiven Spieler"}},"content":"Mit Stolz und gro\xdfer Freude verk\xfcnden wir, dass unsere 1. Mannschaft heute das entscheidende Spiel um den Aufstieg gewonnen hat!\\n\\nGleich in unserer ersten Saison, haben wir eindrucksvoll den Sprung nach oben geschafft und stehen nun vor den letzten beiden Spielen, in denen wir die Meisterschaft f\xfcr uns entscheiden k\xf6nnen.\\n\\nWir m\xf6chten uns an dieser Stelle bei unseren Spielern bedanken, die durch harte Arbeit, Einsatz und Teamgeist diesen Erfolg m\xf6glich gemacht haben.\\n\\nJeder Spieler hat einen wichtigen Beitrag geleistet. Die Jungs waren immer hei\xdf und \xfcber die ganze Saison hinweg, ein schwer zu schlagendes Team.\\n\\nAber wir w\xe4ren nicht hier, wo wir sind, ohne die zahlreiche Unterst\xfctzung unserer Fans, Freunde und Familie. Ihr habt uns bei jedem Spiel angefeuert, uns Mut zugesprochen und uns den R\xfccken gest\xe4rkt. Ohne euch w\xe4ren wir nicht dieselbe Mannschaft. Danke, dass ihr immer an uns geglaubt habt!\\n\\nJetzt liegt es an uns, den letzten Schritt zu gehen und uns die Meisterschaft zu sichern. Wir werden hart arbeiten, uns weiterhin gegenseitig motivieren und alles geben, um den Titel nach Kirrberg zu holen.\\n\\n![GameOn](./climb.png)\\n > vlnr."},{"id":"Unsere aktiven Spieler","metadata":{"permalink":"/blog/Unsere aktiven Spieler","editUrl":"https://github.com/dckirrberg/webiste/edit/main/website/blog/blog/2022-12-01-team/index.md","source":"@site/blog/2022-12-01-team/index.md","title":"Unsere aktiven Spieler","description":"GameOn","date":"2022-12-01T00:00:00.000Z","formattedDate":"December 1, 2022","tags":[{"label":"Aktive","permalink":"/blog/tags/aktive"},{"label":"Saison 22/23","permalink":"/blog/tags/saison-22-23"}],"readingTime":0.175,"truncated":false,"authors":[{"name":"DC Kirrberg e.V.","title":"Die Sterne vom Tussberch","imageURL":"/img/logo.svg","key":"dckirrberg"}],"prevItem":{"title":"Aufsteiger 22/23","permalink":"/blog/climb"},"nextItem":{"title":"Die Saision startet!","permalink":"/blog/Saision 22/23"}},"content":"![GameOn](./Mannschaft.png)\\n > vlnr. Maurice Didion, Sebastian Bauer, Pascal Kittel, Tobias Mallmann, Michael Didion, \\n Leon Yilmaz, Thomas Ewald, Sebastian Planz, Markus Didion, Carsten Dietz, Thorsten Barthelmie, \\n Torsten Halter, Patrick Bentz, Michael Clemens, Torsten Kratz, Nicola Kniest."},{"id":"Saision 22/23","metadata":{"permalink":"/blog/Saision 22/23","editUrl":"https://github.com/dckirrberg/webiste/edit/main/website/blog/blog/2022-09-10-saisonstart/index.md","source":"@site/blog/2022-09-10-saisonstart/index.md","title":"Die Saision startet!","description":"GameOn","date":"2022-09-10T00:00:00.000Z","formattedDate":"September 10, 2022","tags":[{"label":"Spielplan","permalink":"/blog/tags/spielplan"},{"label":"Saison 22/23","permalink":"/blog/tags/saison-22-23"}],"readingTime":0.035,"truncated":false,"authors":[{"name":"DC Kirrberg e.V.","title":"Die Sterne vom Tussberch","imageURL":"/img/logo.svg","key":"dckirrberg"}],"prevItem":{"title":"Unsere aktiven Spieler","permalink":"/blog/Unsere aktiven Spieler"},"nextItem":{"title":"Unser erster Vereinssponsor kommt an(s) Board","permalink":"/blog/sponsor"}},"content":"![GameOn](./Spielplan.png)\\n > Alle Termine der Saision 22/23"},{"id":"sponsor","metadata":{"permalink":"/blog/sponsor","editUrl":"https://github.com/dckirrberg/webiste/edit/main/website/blog/blog/2022-08-19-sponsor/index.md","source":"@site/blog/2022-08-19-sponsor/index.md","title":"Unser erster Vereinssponsor kommt an(s) Board","description":"Eine kontinuierliche und kompetente Vereinsf\xfchrung geh\xf6rt zu den essenziellen Bestandteilen einer erfolgreichen DCKirrberg-Zukunft.","date":"2022-08-19T00:00:00.000Z","formattedDate":"August 19, 2022","tags":[{"label":"Sponsor","permalink":"/blog/tags/sponsor"},{"label":"Deutsche Verm\xf6gensberatung - Sebastian Bauer","permalink":"/blog/tags/deutsche-vermogensberatung-sebastian-bauer"}],"readingTime":0.325,"truncated":false,"authors":[{"name":"DC Kirrberg e.V.","title":"Die Sterne vom Tussberch","imageURL":"/img/logo.svg","key":"dckirrberg"}],"prevItem":{"title":"Die Saision startet!","permalink":"/blog/Saision 22/23"},"nextItem":{"title":"Was lange w\xe4hrt, wird endlich gut!","permalink":"/blog/renovierung"}},"content":"Eine kontinuierliche und kompetente Vereinsf\xfchrung geh\xf6rt zu den essenziellen Bestandteilen einer erfolgreichen DCKirrberg-Zukunft.\\nUmso erfreulicher ist die k\xfcnftige Zusammenarbeit mit unserem Trikot- und Hauptsponsor Sebastian Bauer,\\nin seiner Funktion als Verm\xf6gensberater der <a href=\\"https://www.dvag.de/sebastian.bauer/index.html\\">DVAG</a>. (Deutsche Verm\xf6gensberatung)\\n\\nSebastian ist selbst ein begeisterter Dartsspieler und zudem als Mitgr\xfcnder des Vereins ein fester Bestandteil der DCK-Familie.\\n\\n![GameOn](./markus_seb.png)\\n > Markus Didion (1. Vorsitzender) und Sebastian Bauer nach der Vetragsunterzeichnung"},{"id":"renovierung","metadata":{"permalink":"/blog/renovierung","editUrl":"https://github.com/dckirrberg/webiste/edit/main/website/blog/blog/2022-08-12-umbau/index.md","source":"@site/blog/2022-08-12-umbau/index.md","title":"Was lange w\xe4hrt, wird endlich gut!","description":"Unere Renovierungsarbeiten sind nun fast abgeschlossen und schon jetzt ist die ehem. B\xfccherei","date":"2022-08-12T00:00:00.000Z","formattedDate":"August 12, 2022","tags":[{"label":"B\xfcrgerhaus Kirrberg","permalink":"/blog/tags/burgerhaus-kirrberg"},{"label":"Vereinsheim","permalink":"/blog/tags/vereinsheim"}],"readingTime":0.265,"truncated":false,"authors":[{"name":"DC Kirrberg e.V.","title":"Die Sterne vom Tussberch","imageURL":"/img/logo.svg","key":"dckirrberg"}],"prevItem":{"title":"Unser erster Vereinssponsor kommt an(s) Board","permalink":"/blog/sponsor"},"nextItem":{"title":"Wir starten durch!","permalink":"/blog/newboards"}},"content":"Unere Renovierungsarbeiten sind nun fast abgeschlossen und schon jetzt ist die ehem. B\xfccherei \\nim B\xfcrgerhaus Kirrberg kaum wiederzuerkennen.\\n\\nUnser Dank geht an dieser Stelle an die vielen Unterst\xfctzer und flei\xdfigen Helfer der letzte Tage\\nund Wochen. Ohne euch, h\xe4tten wir den Traum von einer modernen Spielst\xe4tte nicht realisieren k\xf6nnen.\\n\\n\\n![Uebergabe](./1.jpg)\\n\\n![GameOn](./2.jpg)\\n\\n![GameOn](./3.jpg)\\n\\n![GameOn](./4.jpg)"},{"id":"newboards","metadata":{"permalink":"/blog/newboards","editUrl":"https://github.com/dckirrberg/webiste/edit/main/website/blog/blog/2022-01-28-firstboards/index.md","source":"@site/blog/2022-01-28-firstboards/index.md","title":"Wir starten durch!","description":"Genau 3 Tage nach der ersten Trainingseinheit, konnten wir bereits unsere Kontakte spielen lassen.","date":"2022-01-28T00:00:00.000Z","formattedDate":"January 28, 2022","tags":[{"label":"Jens Kniest","permalink":"/blog/tags/jens-kniest"},{"label":"B\xfcrgerhaus Kirrberg","permalink":"/blog/tags/burgerhaus-kirrberg"},{"label":"Trainingsst\xe4tte","permalink":"/blog/tags/trainingsstatte"}],"readingTime":1.035,"truncated":false,"authors":[{"name":"DC Kirrberg e.V.","title":"Die Sterne vom Tussberch","imageURL":"/img/logo.svg","key":"dckirrberg"}],"prevItem":{"title":"Was lange w\xe4hrt, wird endlich gut!","permalink":"/blog/renovierung"},"nextItem":{"title":"Unser Vereinsheim","permalink":"/blog/firststeps"}},"content":"Genau 3 Tage nach der ersten Trainingseinheit, konnten wir bereits unsere Kontakte spielen lassen.\\nDer Darts Profi - Jens Kniest - war bei uns zu Gast und hatte gleich die ersten Boards und Surrounds mitgebracht.\\n\\nDer Saarl\xe4nder Jens Kniest nahm 2018 an der PDC Q-School teil, wonach er regelm\xe4\xdfig bei den Qualifiern f\xfcr die Events der European Tour mit dabei war, der Sprung auf die gro\xdfe ET-B\xfchne sollte ihm bisher noch nicht gelingen. Auch ein Jahr sp\xe4ter nahm der Deutsche die Q-School in Angriff, anschlie\xdfend nahm Kniest auch eine Gro\xdfzahl an Challenge Tour Events mit, bevor er bei den Luxembourg Open die Runde der letzten 32 erreichte. Mitte November gelang dem Dartspieler des DC Olympia dann der gro\xdfe Coup, als er sich f\xfcr die Super League Darts Germany qualifizieren konnte. 2020 begann Kniest erneut in der Q-School, auf der Challenge Tour ging es zum ersten Mal unter die letzten 32. Auch 2021 war Kniest bei der Q-School mit dabei, ebenso bei der Super League Darts Germany 2021, wo er nach dem Ausscheiden in der Vorrundengruppe die Liga aber vorl\xe4ufig verlassen muste.\\n\\n![Uebergabe](./jensk1.png)\\n> Der 1. Vorsitzende Markus Didion nimmt die neuen Boards mit Freuden entgegen\\n\\n\\n\\n![GameOn](./jensk2.jpg)\\n> Nat\xfcrlich wurden die neu erworbenen Scheiben direkt montiert und bespielt!"},{"id":"firststeps","metadata":{"permalink":"/blog/firststeps","editUrl":"https://github.com/dckirrberg/webiste/edit/main/website/blog/blog/2022-01-25-first steps/index.md","source":"@site/blog/2022-01-25-first steps/index.md","title":"Unser Vereinsheim","description":"Wie unschwer zu erkennen ist, ist unsere aktuelle Trainingslocation etwas in die Jahre gekommen.","date":"2022-01-25T00:00:00.000Z","formattedDate":"January 25, 2022","tags":[{"label":"WINMAU Board","permalink":"/blog/tags/winmau-board"},{"label":"B\xfcrgerhaus Kirrberg","permalink":"/blog/tags/burgerhaus-kirrberg"},{"label":"Vereinsheim","permalink":"/blog/tags/vereinsheim"}],"readingTime":0.31,"truncated":false,"authors":[{"name":"DC Kirrberg e.V.","title":"Die Sterne vom Tussberch","imageURL":"/img/logo.svg","key":"dckirrberg"}],"prevItem":{"title":"Wir starten durch!","permalink":"/blog/newboards"},"nextItem":{"title":"1. Mitgliederversammlung","permalink":"/blog/firstmv"}},"content":"Wie unschwer zu erkennen ist, ist unsere aktuelle Trainingslocation etwas in die Jahre gekommen.\\nWir hoffen nat\xfcrlich, uns hier langfristig niederlassen zu d\xfcrfen und mit st\xe4dtischer Unterst\xfctzung den Raum zu neuem Glanz zu verhelfen.\\nDa zu diesem Zeitpunkt noch keine Spielger\xe4teanschaffung m\xf6glich war, begn\xfcgten wir uns voerst mit der Montage einer einzigen Scheibe.\\n\\n![Die Dartscheibe](./firststeps.jpg)\\n> Die erste Scheibe wurde erfolgreich angebracht!"},{"id":"firstmv","metadata":{"permalink":"/blog/firstmv","editUrl":"https://github.com/dckirrberg/webiste/edit/main/website/blog/blog/2021-12-28-firstMV/index.md","source":"@site/blog/2021-12-28-firstMV/index.md","title":"1. Mitgliederversammlung","description":"Mit der 1. Mitgliederversammlung stimmte die Versammlung \xfcber die erforderlichen Vereins- bzw. Satzungsordungen ab.","date":"2021-12-28T00:00:00.000Z","formattedDate":"December 28, 2021","tags":[{"label":"MV","permalink":"/blog/tags/mv"},{"label":"B\xfcrgerhaus Kirrberg","permalink":"/blog/tags/burgerhaus-kirrberg"}],"readingTime":0.295,"truncated":false,"authors":[{"name":"DC Kirrberg e.V.","title":"Die Sterne vom Tussberch","imageURL":"/img/logo.svg","key":"dckirrberg"}],"prevItem":{"title":"Unser Vereinsheim","permalink":"/blog/firststeps"},"nextItem":{"title":"Die Vereinsgr\xfcndung","permalink":"/blog/founding"}},"content":"Mit der 1. Mitgliederversammlung stimmte die Versammlung \xfcber die erforderlichen Vereins- bzw. Satzungsordungen ab.\\nUnsere Vereinssatzung und Ordnungen findet ihr unter <a href=\\"/downloads\\">Downloads</a>.\\nDer Vorstand verk\xfcndete zudem, dass die R\xe4umlichkeit der alten B\xfccherei im B\xfcrgerhaus Kirrberg, k\xfcnftig als\\nTrainingsraum genutzt werden darf.\\n\\n![Hier wird der Grundstein gelegt!](./firstmv.jpg)\\n> Mit viel Enthusiasmus wurde der Grundstein f\xfcr eine erfolgreiche Vereinsarbeit gelegt"},{"id":"founding","metadata":{"permalink":"/blog/founding","editUrl":"https://github.com/dckirrberg/webiste/edit/main/website/blog/blog/2021-11-15-founding/index.md","source":"@site/blog/2021-11-15-founding/index.md","title":"Die Vereinsgr\xfcndung","description":"Am 15.11.2021 versammleten sich 15 begeisterte Freunde des Steeldarts zur Gr\xfcndung des Vereins im Vereinsheim des SV Kirrberg 1945 .","date":"2021-11-15T00:00:00.000Z","formattedDate":"November 15, 2021","tags":[{"label":"Mitglieder","permalink":"/blog/tags/mitglieder"},{"label":"Gr\xfcndungsversammlung","permalink":"/blog/tags/grundungsversammlung"}],"readingTime":0.375,"truncated":false,"authors":[{"name":"DC Kirrberg e.V.","title":"Die Sterne vom Tussberch","imageURL":"/img/logo.svg","key":"dckirrberg"}],"prevItem":{"title":"1. Mitgliederversammlung","permalink":"/blog/firstmv"},"nextItem":{"title":"Unsere Vorstandschaft","permalink":"/blog/welcome"}},"content":"Am 15.11.2021 versammleten sich 15 begeisterte Freunde des Steeldarts zur Gr\xfcndung des Vereins im Vereinsheim des <a href=\\"http://www.svkirrberg.de\\">SV Kirrberg 1945 </a>.\\nIn der ersten ordentlichen Vereinssitzung, w\xe4hlte die Versammlung den Vorstand und beriet im Anschluss die weiteren Ma\xdfnahmen.\\n\\n\\n![Unsere Gruendungsmitglieder](./gruender.jpg)\\n> Die Gr\xfcndungsmitglieder - v.l.n.r. Leon Yilmaz, Michael Didion, Maurice Didion, Andr\xe9 Didion, Philipp Kasper, Nicola Kniest, Tobias Mallmann, Daniel Knecht,\\nPatrick Bentz, Markus Didion, Sebastian Bauer, Sebastian Planz, Pascal Kittel, Torsten Halter, Julia Didion"},{"id":"welcome","metadata":{"permalink":"/blog/welcome","editUrl":"https://github.com/dckirrberg/webiste/edit/main/website/blog/blog/2021-11-15-welcome/index.md","source":"@site/blog/2021-11-15-welcome/index.md","title":"Unsere Vorstandschaft","description":"Der Kernvorstand besteht laut unserer Satzung aus dem 1. Vorsitzenden, dessen Stellvertreter (2. Vorsitzender) und dem 1. Kassenwart.","date":"2021-11-15T00:00:00.000Z","formattedDate":"November 15, 2021","tags":[{"label":"Vorstand","permalink":"/blog/tags/vorstand"},{"label":"Gr\xfcndungsversammlung","permalink":"/blog/tags/grundungsversammlung"}],"readingTime":0.485,"truncated":false,"authors":[{"name":"DC Kirrberg e.V.","title":"Die Sterne vom Tussberch","imageURL":"/img/logo.svg","key":"dckirrberg"}],"prevItem":{"title":"Die Vereinsgr\xfcndung","permalink":"/blog/founding"}},"content":"Der Kernvorstand besteht laut unserer Satzung aus dem 1. Vorsitzenden, dessen Stellvertreter (2. Vorsitzender) und dem 1. Kassenwart.\\nIm erweiterten Vorstand befinden sich 6 weitere Mitglieder. Diese wurden bei der Gr\xfcndungsversammlung am 15.11.2021 ordnungsgem\xe4\xdf gew\xe4hlt \\nund bilden somit die Vorstandschaft des DC Kirrberg e.V.\\n\\nDie Verteilung der einzelnen Posten findet ihr in der nachfolgenden Bildbeschreibung.\\n\\n![Der Vorstand](./vorstand.jpg)\\n> Die Vorstandschaft - v.l.n.r. Nicola Kniest (Schriftf\xfchrer), Maurice Didion (stellv. Schriftf\xfchrer), Pascal Kittel (1. Beisitzer, Pressesprecher), Phillip Kasper (Kassenwart), Markus Didion (1. Vorsitzender), Andr\xe9 Didion (2. Vorsitzender), Patrick Bentz (1. Sportdirektor), Tobias Mallmann (2. Beisitzer), Torsten Halter (2. Sportdirektor)"}]}')}}]);